static inline void node_layer_1_MatMul(const int A[INPUT_LAYER_SIZE_COL],
    int Y[INPUT_LAYER_SIZE_ROW])
{
    /* MatMul */
    for (uint32_t c = 0; c < INPUT_LAYER_SIZE_ROW; c++) {
        Y[c] = 0;
        for (uint32_t i = 0; i < INPUT_LAYER_SIZE_COL; i++) {
            Y[c] += BINARISE(A[c]) * BINARISE(tensor_layer_1_MatMul_weights[c][i]) + BINARISE(tensor_layer_1_Add_bias[c]);
        }
    }
}

